file:
  statement:
    select_statement:
      select_clause:
      - keyword: select
      - select_clause_modifier:
        - keyword: distinct
        - keyword: 'on'
        - bracketed:
          - start_bracket: (
          - expression:
              column_reference:
                identifier: id
          - end_bracket: )
      - select_clause_element:
          expression:
            bracketed:
              start_bracket: (
              expression:
              - column_reference:
                  identifier: json
              - binary_operator: ->
              - literal: "'type'"
              - binary_operator: ->>
              - literal: "'id'"
              end_bracket: )
            cast_expression:
              casting_operator: '::'
              data_type:
                data_type_identifier: int
          alias_expression:
            keyword: as
            identifier: id
      - comma: ','
      - select_clause_element:
          expression:
            bracketed:
              start_bracket: (
              expression:
              - column_reference:
                  identifier: json
              - binary_operator: ->
              - literal: "'type'"
              - binary_operator: ->>
              - literal: "'name'"
              end_bracket: )
          alias_expression:
            keyword: as
            identifier: name
      from_clause:
        keyword: from
        from_expression:
          from_expression_element:
            table_expression:
              bracketed:
                start_bracket: (
                select_statement:
                  select_clause:
                    keyword: select
                    select_clause_element:
                      wildcard_expression:
                        wildcard_identifier:
                          star: '*'
                  from_clause:
                    keyword: from
                    from_expression:
                      from_expression_element:
                        table_expression:
                          table_reference:
                            identifier: sb_route_events
                        alias_expression:
                          keyword: as
                          identifier: s
                  where_clause:
                    keyword: where
                    bracketed:
                      start_bracket: (
                      expression:
                      - column_reference:
                        - identifier: s
                        - dot: .
                        - identifier: match_id
                      - keyword: not
                      - keyword: in
                      - bracketed:
                        - start_bracket: (
                        - select_statement:
                            select_clause:
                              keyword: select
                              select_clause_modifier:
                                keyword: distinct
                              select_clause_element:
                                column_reference:
                                  identifier: match_id
                            from_clause:
                              keyword: from
                              from_expression:
                                from_expression_element:
                                  table_expression:
                                    table_reference:
                                      identifier: this_model
                        - end_bracket: )
                      end_bracket: )
                end_bracket: )
            alias_expression:
              keyword: as
              identifier: e
